import React from "react";



function TranslateButtonContainer() {


  return (
    <div className="translate-button-container">
      <div className="frame">
        <button className="translate-2 valign-text-middle poppins-normal-black-14px">translate</button>
        <button className="translate-2 valign-text-middle poppins-normal-black-14px">save</button>
        <button className="translate-2 valign-text-middle poppins-normal-black-14px">clear</button>
      </div>
    </div>
  );
}

export default TranslateButtonContainer;
